Where necessary, the values in the example can be empty or unset, but accommodate with comments regarding this intention. Where feasible, the content and values used in an example should convey the fullest use of the data structures concerned. Most commonly onlookers will intend to copy-and-paste a "working example". If the intention of the example is to be a fully utilized example, rather than a copy-and-paste example, perhaps add a comment as such. ### Example { "foo": null, "bar": ""
} vs. ### Example Following is a fully populated example (not necessarily for copy/paste use) { "foo": [ 1, 2, 3 ], "bar": "waffles", "bif": { "baz": "potatoes" }
}
